import "./Sidemenu.scss";
import { Link } from 'react-router-dom';


function Sidemenu(props) {
  console.log(props);
  return (
    <ul className="list">
      <Link  to="/about">
        <li>About</li>
      </Link>
      <Link to="/shop">
        <li>Tech</li>
      </Link>
      <Link to="/shop">
        <li>Projects</li>
      </Link>
    </ul>
  );
}

export default Sidemenu;
